class Solution {

    /**
     * @param String $s
     * @return Integer
     */
    function maximumLength($s) {
        $result = -1;
        for ($i = 0; $i < strlen($s); $i++) {
            for ($len = 1; $i + 2 * $len <= strlen($s); $len++) {
                $substr = substr($s, $i, $len);
                $count = 0;
                for ($j = $i; $j <= strlen($s) - $len; $j++) {
                    if (substr($s, $j, $len) === $substr) {
                        $count++;
                    }
                }
                if ($count >= 3) {
                    $result = max($result, $len);
                }
            }
        }
        return $result;
    }
}
